Dataset_updated_2.query:
q = load "${Apps.sfdc_internal__AdminAnalytics.Datasets.LightningPageView.Alias}";
q = foreach q generate 'TIMESTAMP_DERIVED' as 'TIMESTAMP_DERIVED', 'TIMESTAMP_DERIVED_Day' as 'TIMESTAMP_DERIVED_Day', 'TIMESTAMP_DERIVED_Month' as 'TIMESTAMP_DERIVED_Month', 'TIMESTAMP_DERIVED_Year' as 'TIMESTAMP_DERIVED_Year';
q = order q by 'TIMESTAMP_DERIVED' desc;
q = foreach q generate  'TIMESTAMP_DERIVED_Year' + "-" +'TIMESTAMP_DERIVED_Month' + "-" + 'TIMESTAMP_DERIVED_Day' as 'Time';
q = limit q 1;

lens_1.query:
q = load "${Apps.sfdc_internal__AdminAnalytics.Datasets.LightningPageView.Alias}";
q = group q by ('TIMESTAMP_DERIVED_Year', 'TIMESTAMP_DERIVED_Month', 'TIMESTAMP_DERIVED_Day');
q_A = filter q by 'EFFECTIVE_PAGE_TIME' >= 0 && 'EFFECTIVE_PAGE_TIME' <= 3000;
q_B = filter q by 'EFFECTIVE_PAGE_TIME' >= 3001 && 'EFFECTIVE_PAGE_TIME' <= 5000;
q_C = filter q by 'EFFECTIVE_PAGE_TIME' >= 5001 && 'EFFECTIVE_PAGE_TIME' <= 8000;
q_D = filter q by 'EFFECTIVE_PAGE_TIME' >= 8001 && 'EFFECTIVE_PAGE_TIME' <= 10000;
q_E = filter q by 'EFFECTIVE_PAGE_TIME' >= 10001;
buck1 = foreach q_A generate  q_A.'TIMESTAMP_DERIVED_Year' + "-" + q_A.'TIMESTAMP_DERIVED_Month' + "-" + q_A.'TIMESTAMP_DERIVED_Day' as 'Time', "EPT 0-3s" as 'Metric',count() as 'count';
buck2 = foreach q_B generate  q_B.'TIMESTAMP_DERIVED_Year' + "-" + q_B.'TIMESTAMP_DERIVED_Month' + "-" + q_B.'TIMESTAMP_DERIVED_Day' as 'Time', "EPT 3-5s" as 'Metric',count() as 'count';
buck3 = foreach q_C generate  q_C.'TIMESTAMP_DERIVED_Year' + "-" + q_C.'TIMESTAMP_DERIVED_Month' + "-" + q_C.'TIMESTAMP_DERIVED_Day' as 'Time', "EPT 5-8s" as 'Metric',count() as 'count';
buck4 = foreach q_D generate  q_D.'TIMESTAMP_DERIVED_Year' + "-" + q_D.'TIMESTAMP_DERIVED_Month' + "-" + q_D.'TIMESTAMP_DERIVED_Day' as 'Time', "EPT 8-10s" as 'Metric',count() as 'count';
buck5 = foreach q_E generate  q_E.'TIMESTAMP_DERIVED_Year' + "-" + q_E.'TIMESTAMP_DERIVED_Month' + "-" + q_E.'TIMESTAMP_DERIVED_Day' as 'Time', "EPT > 10s" as 'Metric',count() as 'count';
final=union buck1,buck2,buck3,buck4,buck5;
final = group final by ('Time', 'Metric');
final = foreach final generate 'Time' as 'Time', 'Metric' as 'Metric', sum('count') as 'Total';
final = order final by ('Metric');

lens_2.query:
q = load "${Apps.sfdc_internal__AdminAnalytics.Datasets.LightningPageView.Alias}";
q = filter q by 'PAGE_ENTITY_TYPE' != "";
q = group q by 'PAGE_ENTITY_TYPE';
q_A = filter q by 'EFFECTIVE_PAGE_TIME' >= 0 && 'EFFECTIVE_PAGE_TIME' <= 3000;
q_B = filter q by 'EFFECTIVE_PAGE_TIME' >= 3001 && 'EFFECTIVE_PAGE_TIME' <= 5000;
q_C = filter q by 'EFFECTIVE_PAGE_TIME' >= 5001 && 'EFFECTIVE_PAGE_TIME' <= 8000;
q_D = filter q by 'EFFECTIVE_PAGE_TIME' >= 8001 && 'EFFECTIVE_PAGE_TIME' <= 10000;
q_E = filter q by 'EFFECTIVE_PAGE_TIME' >= 10001;
buck1 = foreach q_A generate  'PAGE_ENTITY_TYPE' as 'PAGE_ENTITY_TYPE', "EPT 0-3s" as 'Metric',count() as 'count';
buck2 = foreach q_B generate  'PAGE_ENTITY_TYPE' as 'PAGE_ENTITY_TYPE', "EPT 3-5s" as 'Metric',count() as 'count';
buck3 = foreach q_C generate 'PAGE_ENTITY_TYPE' as 'PAGE_ENTITY_TYPE', "EPT 5-8s" as 'Metric',count() as 'count';
buck4 = foreach q_D generate 'PAGE_ENTITY_TYPE' as 'PAGE_ENTITY_TYPE', "EPT 8-10s" as 'Metric', count() as 'count';
buck5 = foreach q_E generate 'PAGE_ENTITY_TYPE' as 'PAGE_ENTITY_TYPE', "EPT > 10s" as 'Metric',count() as 'count';
final=union buck1,buck2,buck3,buck4,buck5;
final = group final by ('PAGE_ENTITY_TYPE', 'Metric');
final = foreach final generate 'PAGE_ENTITY_TYPE' as 'PAGE_ENTITY_TYPE', 'Metric' as 'Metric', sum('count') as 'Total';
